import React, { Component } from "react";
import { Container } from "semantic-ui-react";
import { connect } from "react-redux";
import { NavBar } from "./NavBar";
import { InvitationAlert } from "./invitationAlert";
import { DownloadLinks } from "./DownloadLinks";
import HeaderSection from "./header";
import HowIsWorks from "./HowIsWorks";
import Footer from "./Footer";
import { ContactForm } from "./ContactForm";
import { withTranslation } from "react-i18next";
import GeneralSection from "./GeneralSection";
import "./LandingPage.css";
import DesktopBreakpoint from "../../components/Responsive_utillities/desktop_breakPoint";
import PhoneBreakpoint from "../../components/Responsive_utillities/phone_breakPoint";
class LandingPage extends Component {
  componentDidMount() {
    console.log("isActive parent", this.props.isActive);
  }
  render() {
    const { isActive, t } = this.props;
    return (
      <Container>
        <DesktopBreakpoint name="desktop">
          <NavBar />
          {isActive ? (
            <div>
              <InvitationAlert />
            </div>
          ) : (
            <div></div>
          )}
          <HeaderSection />
          <HowIsWorks />
          <GeneralSection />
          <ContactForm />
          <Footer />
        </DesktopBreakpoint>

        <PhoneBreakpoint name="phone">
          <NavBar />
          {isActive ? (
            <div>
              <InvitationAlert />
            </div>
          ) : (
            <div></div>
          )}
          <DownloadLinks />
          <HeaderSection />
          <HowIsWorks />
          <GeneralSection />
          <ContactForm />
          <Footer />
        </PhoneBreakpoint>
      </Container>
    );
  }
}
function mapState(state) {
  const { isActive } = state.users;
  return { isActive };
}

const actionCreators = {};
const connectedLandingPage = connect(mapState, actionCreators)(withTranslation("landingPage")(LandingPage));
export { connectedLandingPage as LandingPage };
